    <div className="bloglist">
      <Card key={id}>
        <Card.Img variant="top" src={imgUrl} />
        <Card.Body>
          <Card.Title> {product.name}</Card.Title>
          <Card.Text>
            <p>{product.price}</p>
          </Card.Text>
        </Card.Body>
      </Card>
    </div>
  );
};

